import React from "react";

export default function Navbar() {
  return (
    <nav className="w-full flex justify-between items-center px-6 py-4 bg-white shadow-sm">
      <div className="text-2xl font-bold tracking-widest text-[#4a2c1f]">
        N<span className="text-[#8b5e3c]">&</span>S
      </div>
      <ul className="hidden md:flex gap-6 text-[#4a2c1f] font-semibold text-sm uppercase">
        <li className="hover:text-[#8b5e3c] cursor-pointer">About Us</li>
        <li className="hover:text-[#8b5e3c] cursor-pointer">Wedding Day</li>
        <li className="hover:text-[#8b5e3c] cursor-pointer">Photos</li>
        <li className="hover:text-[#8b5e3c] cursor-pointer">RSVP</li>
        <li className="hover:text-[#8b5e3c] cursor-pointer">Blog</li>
      </ul>
      <button className="bg-[#8b5e3c] text-white text-sm px-4 py-2 rounded-md hover:bg-[#71472e]">
        View Now
      </button>
    </nav>
  );
}
